import React from "react";
import {
  Container,
  Nav,
  Navbar,
  DropdownButton,
  Dropdown,
  Row,
} from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUserCircle } from "@fortawesome/free-solid-svg-icons";
import "./Navbar.css";
import logo from "../img/EBS.jpg";
import Cookies from "universal-cookie/es6";

const cookies = new Cookies();

export default class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  logout() {
    cookies.remove("_s");
    window.location.reload();
  }

  render() {
    return (
      <Navbar id="navbar" variant="dark">
        <img className="img-logo" src={logo} alt="logo" href="/home" />
        <Container>
          <Navbar.Brand href="/home">
            <h1>Eventos de Bienestar Social</h1>{" "}
            <span id="usuario-sub-branm"></span>
          </Navbar.Brand>

          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              {/*<Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>*/}
            </Nav>
            <DropdownButton
              id="dropdown-basic-button"
              size="lg"
              title="Usuario"
            >
              <Dropdown.Header id="dropdown-header">
                <Row>
                  <FontAwesomeIcon icon={faUserCircle} />
                </Row>
                <Row>USUARIO</Row>
              </Dropdown.Header>
              <Dropdown.Item href="/login">Login</Dropdown.Item>
              <Dropdown.Item href="/eventos">Crud</Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item onClick={this.logout}>Cerrar Sesi√≥n</Dropdown.Item>
              {/*<Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>*/}
            </DropdownButton>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    );
  }
}
